import {
    createBrowserRouter, RouterProvider
} from "react-router-dom";
import 'bootstrap/dist/css/bootstrap.min.css';
/*
* Eventually will load data from a database
*
* */
import {ExamplePage} from "./toy_examples/ExamplePage";
import {VizNavigation} from "./routes/VizNavigation";
import NoMatch from "./routes/NoMatch";
import Container from "react-bootstrap/Container";
import Navbar from "react-bootstrap/Navbar";
import Nav from "react-bootstrap/Nav";
const App = () => {
    const router = createBrowserRouter([

        {
            path: "/chicago-crime-viz",
            element: <Navbar expand="lg" className="bg-body-tertiary">
                <Container>
                    <Navbar.Brand href="/chicago-crime-viz">Home</Navbar.Brand>
                    <Navbar.Toggle aria-controls="basic-navbar-nav" />
                    <Navbar.Collapse id="basic-navbar-nav">
                        <Nav className="me-auto">
                            <Nav.Link href="/chicago-crime-viz/example-page"></Nav.Link>
                            <Nav.Link href="#link">Link</Nav.Link>
                        </Nav>
                    </Navbar.Collapse>
                </Container>
            </Navbar>
        }
    ]);
    return (
        <>
            <RouterProvider router={router}/>
            </>
    );
};
export default App;
